import { css } from '@emotion/css';

export const styContainer = css`
  margin-top: 50px;
  overflow: scroll;
  height: calc(100vh - 235px);
  display: flex;
  flex-direction: column;
  justify-content: space-between;
`;

export const styContainerBottom = css`
  display: flex;
  justify-content: space-between;
  margin-bottom:10;x
`;
